import {CupideonHomeLogo, CupideonHomeWrapper} from "../styled/CupideonHome.styled";
import PressLogo from "../../admin/assets/logo.svg";

function CupideonHome(){
    return(
        <CupideonHomeWrapper>
            <CupideonLogoWrapper>
                <CupideonHomeLogo src={PressLogo}/>
            </CupideonLogoWrapper>
            <h1>Hello World.</h1>
        </CupideonHomeWrapper>
    )
}

export default CupideonHome
